import re
import base64
import urllib.parse
import sys

bpaFile = None

try:
    if sys.argv.index('--arquivo') == 1:
        filename = sys.argv[2]
        bpaFile = open(filename, 'r')
        print('Abrindo arquivo {} ...'.format(filename))
        
except ValueError:
    print('Sintaxe invalida! Digite os argumentos da seguite forma:')
    print('app.py --arquivo nome_do_arquivo.txt\n')
    sys.exit()

# initialize app vars
db_procedures_list = ''
db_procedures_list = base64.b64decode(db_procedures_list)
db_procedures_list = db_procedures_list.decode('utf-8')
db_procedures_list = urllib.parse.unquote(db_procedures_list)

logFile = {}
finalLog = {}
reportFile = None
date = None
exportListFormat = ''

def get_procedure_name(procedure_number):
    procedure_number = procedure_number.replace('.', '').replace('-', '')
    procedure_name = db_procedures_list.split(procedure_number)[1].split('|')[0]
    return procedure_name

def read_procedures_to_dict():
    global date
    
    while True:
        line = bpaFile.readline()

        if date == None:
            print('Buscando competencia...')

            # Look for file month
            dateSearch = re.search(r'[A-Z]{3}/[0-9]{4}', line)

            if dateSearch:
                date = line[73:81]
                print("COMPETENCIA: {}".format(date))

        # Look for a CNES code
        cnesSearch = re.search(r'CNES   : [0-9]{7}', line)

        if cnesSearch:
            # save the CNES code and initialize an empty array
            cnes = line.split(':')[1].strip()
            logFile[cnes] = []
            print('\nCNES [{}]'.format(cnes))

        # Look for equals procedures codes
        procedureSearch = re.search(
            r'[0-9]{2}\.[0-9]{2}\.[0-9]{2}\.[0-9]{3}\-[0-9]', line)

        if procedureSearch:
            procedureCode = line[22:36]
            procedureCount = int(line[49:57].strip())
            print('Procedimento: {} \t Total: {}'.format(procedureCode, procedureCount))

            logFile[cnes].append([procedureCode, procedureCount])

        # check end of file
        if not line:
            break

def consolidate_procedures():
    for cnes in logFile:
        procedures = logFile[cnes]

        lastCode = ''
        finalCount = 0
        tmpData = {}

        for procedure in procedures:
            if lastCode == procedure[0]:
                finalCount += procedure[1]
            else:
                finalCount = procedure[1]

            tmpData[procedure[0]] = finalCount
            lastCode = procedure[0]

        finalLog[cnes] = tmpData

def generate_report_data():
    global exportListFormat
    print('\nGerando relatório final...')

    for cnes, procedures in finalLog.items():
        exportListFormat += '<h4>CNES: ' + cnes + '</h4>\n'
        tmpProceduresList = '<pre>'
        tmpProceduresList += '{:<15}{:>7}{}{}\n'.format(
            'Procedimento', 'Total', ' '*5, 'Descricao\n')

        for procNumber, procTotal in procedures.items():
            tmpProceduresList += '{:<15}{:>7}{}{}\n'.format(
                procNumber, procTotal, ' '*5, get_procedure_name(procNumber))

        tmpProceduresList += '</pre>\n'
        exportListFormat += tmpProceduresList

def save_report_to_file():
    reportFile = open('{}.html'.format(date.replace('/', '-')), 'w+')
    reportFile.write(exportListFormat)
    reportFile.close()
    bpaFile.close()
    print('Pronto.')

read_procedures_to_dict()
consolidate_procedures()
generate_report_data()
save_report_to_file()